import { style } from "@mui/system";
import styled from "styled-components";


export const SingUpFormContainer = styled.div`
  display: grid;
  place-items: center;
 
`

export const SingUpContainer = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    width: 23rem;
    margin: 1rem auto;
    padding: 0 1rem;
    box-sizing: border-box;
`

export const ButtonCadastro = styled.div`
        
  width: 328px;
  height: 42px;
  padding: 3px 16px;
  border-radius: 2px; 
  
`

export const TexfieldContainer = styled.div`
  width: 331px;
  height: 360px;
  margin: 20px 0px 0;
  padding: 0 16px 8px;
`

export const TextSingUp = styled.h4`
      font-size: 1rem;
      text-align: center;
      font-weight: normal;
      letter-spacing: -0.39px;
      color: #000000;
`

export const LogoImage = styled.img`
  width: 104px;
  height: 58px;
  margin: 24px 128px 16px;
  object-fit: contain;
`;
